import React, { Component } from 'react';
import './gradeEntry.css';
import TableItemHead from './TableItemHead';


class GradeEntryTable extends Component {
    render() {
        const asList = [
                {
            title: "Introduction to Class",
            points: 15
        },
        {
            title: "Assignment 1",
            points: 20
        }
        ]



        const assignmentList = asList.map(item => {

            return <TableItemHead title={item.title} points={item.points}/>
        })
        assignmentList.unshift()
        assignmentList.splice(0, 1, <TableItemHead title="Student Name"/>)
        

        return (
            <div className="table-responsive">
            <table className="table table-bordered">
              <thead>
                <tr>
                  {assignmentList}
                </tr>
              </thead>
              <tbody>
                <tr>
               
                  <td className="cell">15</td>
                  <td className="cell">10</td>
                 
                </tr>
                <tr>

                  <td className="cell">25</td>
                  <td className="cell">10</td>

                </tr>
              </tbody>
            </table>
            </div>
            
        );
    }
}

export default GradeEntryTable;
